import VueRouter from "vue-router";

import Login from "../pages/Login.vue"

export default new VueRouter({
    routes:[
        {
            name:'Login',
            path:'/',
            component: Login,
        },
        {
            name:'Home',
            path:'/home',
            component: Home,
        }
    ]
})
